function SmallSectionSingle( {cname, image, heading, buttonContent} ) {
  return (
    <div class={`section ${cname}`}>
        <div class="section-left">
            <img src={image} alt="img" class="section-image" />
        </div>
        <div class="section-right">
            <p class="section-right__content">{heading}</p>
            <a href="/" class="button">{buttonContent}</a>
        </div>
    </div>
  );
}

export default SmallSectionSingle;
